def parse_struct_members(text):
    # Regular expression to match member declarations, allowing for any amount of whitespace
    pattern = r'\s*(\S+)\s+(\S+)\s*;'
    # Find all matches in the text
    matches = re.findall(pattern, text)
    # Return a list of tuples (type, member_name)
    return [(match[0], match[1]) for match in matches]


